&quot;Gabbar is Back&quot; is an upcoming Hindi action, drama film directed by Krish and produced by Sanjay Leela Bhansali and Viacom 18 Motion Pictures. Featuring Akshay Kumar in the title role, the film is a remake of the Tamil film Ramana directed by A. R. Murugadoss. Shruti Haasan and Jaideep Ahlawat play supporting roles, and Kareena Kapoor Khan appears in a cameo. The film will release on 1 May 2015.


