02. Aao Raja - Neha Kakkar, Yo Yo Honey Singh &amp; Teflon
03. Cofee Peetey Peetey - Dev Negi &amp; Paroma Das Gupta
04. Warna Gabbar Aa Jayega - Manj Musik &amp; Raftaar


